import React from 'react';


class MatchDetails extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      matchDetails:{}
    }
  }
  componentDidMount(){
    this.setState({matchDetails:this.props.matchDetails})
  }
  componentWillReceiveProps(){
    this.setState({matchDetails:this.props.matchDetails})
  }
  render(){
    let { matchDetails } = this.state;
    return (
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">Match Details</h5>
          <h6 className="card-subtitle mb-2 text-muted">
            <span class="team1">{matchDetails?matchDetails['team-1']:''}</span>
            <span class="vs">Vs</span>
            <span class="team2">{matchDetails?matchDetails['team-2']:''}</span>
          </h6>
          <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
          <a href="#" className="card-link">Card link</a>
          <a href="#" className="card-link">Another link</a>
        </div>
      </div>
    )
  }

}
export default MatchDetails;
